import React, { Component } from 'react'
import logo from '../components/logo-logic.svg'
import Styles from './employee.module.css'
class HeaderComponent extends Component {
    constructor(props) {
        super(props);
        const {isAuth}=this.props;
        console.log("Head Auth",isAuth);
        this.state = {
                 isLoggedIn:isAuth,
        }
    }

    render() {
       return(
        <div className='fixed-top'>
                <header>
                    <nav className="navbar navbar-expand-md bg-black">
                    <a href='/employees' className={Styles.logoImage}><img src={logo}  alt="logo" /></a>
                    </nav>
                    <h5 className='text-end'>Employee Management App</h5>
                </header>
            </div>
       )
    }
}

export default HeaderComponent
